import styled from 'styled-components'

import Box from '@material-ui/core/Box'

export const Container = styled(Box)`
    display: flex;
    justify-content:center;
    margin-right:26px;
    margin-left: 26px
`
export const ContainerTitle = styled(Box)`
    margin-right: 26px;
    margin-left: 26px;
    font-size: 14px;
    line-height: 18px;
`
